import DMSmall from './despicable-me/small.jpg';
import DMLarge from './despicable-me/large.jpg';
import FrozSmall from './frozen/small.jpg';
import FrozLarge from './frozen/large.jpg';
import HTSmall from './hotel-transylvania/small.jpg';
import HTLarge from './hotel-transylvania/large.jpg';
import SASmall from './spirited-away/small.jpg';
import SALarge from './spirited-away/large.jpg';
import UpSmall from './up/small.jpg';
import UpLarge from './up/large.jpg';

const children = [
    { Title: 'Descipcable Me', Small: DMSmall, Large: DMLarge },
    { Title: 'Frozen', Small: FrozSmall, Large: FrozLarge },
    { Title: 'Hotel Transylvania', Small: HTSmall, Large: HTLarge },
    { Title: 'Spirited Away', Small: SASmall, Large: SALarge },
    { Title: 'Up', Small: UpSmall, Large: UpLarge },
]

export default children;
